import React from 'react';
import AvailabilityManager from './AvailabilityManager';

function DoctorDashboard() {
  return (
    <div className="container mt-4">
      <h2>Doctor Dashboard</h2>
      <AvailabilityManager />
    </div>
  );
}

export default DoctorDashboard;
